import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'
const hamburgerContainer = document.querySelector("#headerNav");
const hamburger = document.querySelector(".header__main-nav--hamburger");
const links = document.querySelectorAll(".headerNavLinks li");

hamburger.addEventListener("click", () => {
hamburgerContainer.classList.toggle("clicked");
links.forEach((link) => {
link.classList.toggle("fade");
});
});

window.onscroll = function() {myFunction()};

var navbar = document.getElementById("navbar");
var sticky = navbar.offsetTop;

function myFunction() {
  if (window.pageYOffset >= sticky) {
    navbar.classList.add("sticky")
  } else {
    navbar.classList.remove("sticky");
  }
}
ReactDOM.render(
  <>
<div id="navbar">
<div class="nav-right visible-xs">
  <div class="button" id="btn">
    <div class="bar top"></div>
    <div class="bar middle"></div>
    <div class="bar bottom"></div>
  </div>
</div>

<div className="topnav" id="myTopnav">
  <nav id="headerNav">
    <div className="header__main-nav--hamburger">
      <div className="line line-1"></div>
      <div className="line line-2"></div>
      <div className="line line-3"></div>
    </div>
    <ul className="headerNavLinks">
      <li><a href=" " className="active">Home</a></li>
      <li><a href="#book">BOOK NOW</a></li>
      <li><a href="#about">ABOUT US</a></li>
      <li><a href="#contact">CONTACT US</a></li>
    </ul>
  </nav>

</div>

</div>

  </>
  ,
  document.getElementById("root")
);
